import React from "react";
import { useNavigate } from "react-router";

const ForwBackButton = () => {
  const navigate = useNavigate();
  return (
    <div>
      {" "}
      <button className="btnStyle btn btn-primary" onClick={() => navigate(-1)}>
        atras
      </button>
      <button className="btnStyle btn btn-primary" onClick={() => navigate(+1)}>
        adelante
      </button>
    </div>
  );
};

export default ForwBackButton;
